description:
Milwaukee at Last!!! is the seventh album (and second live album) by the Canadian-American singer-songwriter Rufus Wainwright, released in the United States on September 22, 2009.The album consists of live recordings from his August 27, 2007 performance at Pabst Theater in Milwaukee, Wisconsin in support of his previous studio album, Release the Stars (2007).



1.&quot;Release the Stars&quot; 
2.&quot;Going to a Town&quot; 
3.&quot;Sanssouci&quot; 
4.&quot;Rules and Regulations&quot; 
5.&quot;Leaving for Paris No. 2&quot; 
6.&quot;If Love Were All&quot; 
7.&quot;Nobody's Off the Hook&quot; 
8.&quot;Not Ready to Love&quot; / &quot;Slideshow&quot; 
9.&quot;Macushla&quot;
10.&quot;Gay Messiah&quot; 

